"use strict";

$((function() {
    let tableNum = $(".table-numbers");
    for (let i = 0; i < 600; i++) {
        const row = document.createElement("tr");
        tableNum.append(row);
        for (let j = 0; j < 1; j++) {
            const cell = document.createElement("td");
            row.append(cell);
            const qnt = document.createTextNode(i);
            cell.append(qnt);
        }
    }
    $(".goroda").each((function() {
        var arr = $(this).find(".dws_goroda_list a");
        var region = $(this).find(".heading").text();
        var table = document.createElement("table");
        $("#table-here").append(table);
        var head = document.createElement("caption");
        table.append(head);
        $(head).text(region);
        $(arr).each((function(index, element) {
            console.log(index + ":" + $(element).attr("title"));
            var title = $(element).attr("title");
            var qnt = $(index);
            console.log(qnt);
            console.log(title);
            for (let i = 0; i < 1; i++) {
                const row = document.createElement("tr");
                table.append(row);
                for (let j = 0; j < 1; j++) {
                    const cell = document.createElement("td");
                    row.append(cell);
                    const text = document.createTextNode(`${title}`);
                    cell.append(text);
                }
            }
        }));
    }));
}));